import Navbar from '../components/Navbar';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';

const Index = () => {
    return (
        <div className="mainDiv">
            <Navbar />

            {/* <Autocomplete
                id="free-solo-demo"
                freeSolo
                renderInput={(params) => (
                    <TextField
                        {...params}
                        label="freeSolo"
                        margin="normal"
                        variant="outlined"
                    />
                )}
            /> */}

            <TextField
                label="Search movies..."
                margin="normal"
                variant="outlined"
            />

            <h1>This is the story of my life</h1>
            <div>I hope you like it</div>
        </div>
    );
};

export default Index;
